import React from 'react';
import { Image, Button, Icon, Label, Divider, Grid, Header } from 'semantic-ui-react';
import Comments from './comment.js';
import Buttons from "./buttons.js";

import sw from "./sw.jpeg";

import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Portfolio from './screens/Portfolio'
import About from './screens/About'
import Home from './screens/Home';

import NavBarElements from './components/NavBar/NavBarElements.js';


function App() {
  return (
    <div>
      <Router>
      <NavBarElements/>
      <Routes>
        <Route path = "/Home" element = {<Home/>}/>
        <Route path = "/Portfolio" element = {<Portfolio/>}/>
        <Route path = "/About" element = {<About/>}/>
      </Routes>
    </Router>

      <Grid centered>
        <Grid.Row>
          <Image src = {sw} centered />
        </Grid.Row>
        <Grid.Row>
        <Buttons/>
        </Grid.Row>
      </Grid>
    <br/>

    <Divider horizontal>
      <Header as = "h4">
        <Icon name = "comment alternate" style = {{color: "white"}}/>
        후기를 남겨주세요
      </Header>
    </Divider>
    <Comments/>
    </div>
)}

export default App;
